--
-- Estructura de tabla para la tabla `auditoria_cambios`
--

CREATE TABLE `auditoria_cambios` (
  `Auditoria_ID` bigint(20) UNSIGNED NOT NULL,
  `Tabla` varchar(100) NOT NULL COMMENT 'Nombre de la tabla afectada',
  `Registro_ID` bigint(20) UNSIGNED NOT NULL COMMENT 'ID del registro afectado',
  `Tipo_Operacion` enum('INSERT','UPDATE','DELETE') NOT NULL COMMENT 'Tipo de operación realizada',
  `Valores_Anteriores` longtext CHARACTER SET utf8mb4 COLLATE utf8mb4_bin DEFAULT NULL COMMENT 'Valores anteriores del registro (para UPDATE/DELETE)' CHECK (json_valid(`Valores_Anteriores`)),
  `Valores_Nuevos` longtext CHARACTER SET utf8mb4 COLLATE utf8mb4_bin DEFAULT NULL COMMENT 'Valores nuevos del registro (para INSERT/UPDATE)' CHECK (json_valid(`Valores_Nuevos`)),
  `Campos_Modificados` longtext CHARACTER SET utf8mb4 COLLATE utf8mb4_bin DEFAULT NULL COMMENT 'Campos que fueron modificados (para UPDATE)' CHECK (json_valid(`Campos_Modificados`)),
  `ID_H_O_D` varchar(100) NOT NULL COMMENT 'Identificador de la organización/hospital',
  `Usuario` varchar(200) DEFAULT NULL COMMENT 'Usuario que realizó la operación',
  `IP_Address` varchar(45) DEFAULT NULL COMMENT 'Dirección IP del usuario',
  `User_Agent` text DEFAULT NULL COMMENT 'User Agent del navegador',
  `Fecha_Operacion` timestamp NOT NULL DEFAULT current_timestamp() COMMENT 'Fecha y hora de la operación',
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  `deleted_at` timestamp NULL DEFAULT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

