--
-- Estructura de tabla para la tabla `cajas`
--

CREATE TABLE `cajas` (
  `id` bigint(20) UNSIGNED NOT NULL,
  `nombre` varchar(255) NOT NULL,
  `descripcion` varchar(255) DEFAULT NULL,
  `saldo_inicial` decimal(15,2) NOT NULL DEFAULT 0.00,
  `saldo_actual` decimal(15,2) NOT NULL DEFAULT 0.00,
  `estado` enum('abierta','cerrada','en_uso') NOT NULL DEFAULT 'cerrada',
  `sucursal_id` bigint(20) UNSIGNED NOT NULL,
  `usuario_apertura_id` bigint(20) UNSIGNED DEFAULT NULL,
  `usuario_cierre_id` bigint(20) UNSIGNED DEFAULT NULL,
  `fecha_apertura` timestamp NULL DEFAULT NULL,
  `fecha_cierre` timestamp NULL DEFAULT NULL,
  `observaciones_apertura` text DEFAULT NULL,
  `observaciones_cierre` text DEFAULT NULL,
  `diferencia` decimal(15,2) NOT NULL DEFAULT 0.00,
  `activa` tinyint(1) NOT NULL DEFAULT 1,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  `deleted_at` timestamp NULL DEFAULT NULL,
  `Id_Licencia` varchar(100) DEFAULT NULL COMMENT 'Identificador de licencia del sistema'
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

