--
-- Estructura de tabla para la tabla `carritos_enfermeros`
--

CREATE TABLE `carritos_enfermeros` (
  `id` bigint(20) UNSIGNED NOT NULL,
  `codigo` varchar(20) NOT NULL,
  `nombre` varchar(100) NOT NULL,
  `descripcion` text DEFAULT NULL,
  `enfermero_id` bigint(20) UNSIGNED DEFAULT NULL,
  `sucursal_id` bigint(20) UNSIGNED NOT NULL,
  `consultorio_id` bigint(20) UNSIGNED DEFAULT NULL,
  `ubicacion_actual` varchar(100) DEFAULT NULL,
  `piso` varchar(10) DEFAULT NULL,
  `sector` varchar(50) DEFAULT NULL,
  `observaciones_ubicacion` text DEFAULT NULL,
  `tipo` enum('general','emergencia','especializado','cirugia') NOT NULL DEFAULT 'general',
  `numero_gavetas` int(11) NOT NULL DEFAULT 10,
  `refrigerado` tinyint(1) NOT NULL DEFAULT 0,
  `oxigeno` tinyint(1) NOT NULL DEFAULT 0,
  `monitoreo` tinyint(1) NOT NULL DEFAULT 0,
  `estado` enum('disponible','en_uso','mantenimiento','fuera_servicio') NOT NULL DEFAULT 'disponible',
  `activo` tinyint(1) NOT NULL DEFAULT 1,
  `observaciones` text DEFAULT NULL,
  `equipamiento` longtext CHARACTER SET utf8mb4 COLLATE utf8mb4_bin DEFAULT NULL CHECK (json_valid(`equipamiento`)),
  `medicamentos_estandar` longtext CHARACTER SET utf8mb4 COLLATE utf8mb4_bin DEFAULT NULL CHECK (json_valid(`medicamentos_estandar`)),
  `instrucciones_uso` text DEFAULT NULL,
  `creado_por` varchar(100) DEFAULT NULL,
  `actualizado_por` varchar(100) DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  `deleted_at` timestamp NULL DEFAULT NULL,
  `Id_Licencia` varchar(100) DEFAULT NULL COMMENT 'Identificador de licencia del sistema'
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

