--
-- Estructura de tabla para la tabla `clientes`
--

CREATE TABLE `clientes` (
  `id` bigint(20) UNSIGNED NOT NULL,
  `codigo` varchar(20) NOT NULL,
  `nombre` varchar(100) NOT NULL,
  `apellido` varchar(100) NOT NULL,
  `razon_social` varchar(255) DEFAULT NULL,
  `email` varchar(100) DEFAULT NULL,
  `telefono` varchar(20) DEFAULT NULL,
  `celular` varchar(20) DEFAULT NULL,
  `dni` varchar(20) DEFAULT NULL,
  `cuit` varchar(20) DEFAULT NULL,
  `tipo_persona` enum('fisica','juridica') NOT NULL DEFAULT 'fisica',
  `direccion` text DEFAULT NULL,
  `ciudad` varchar(50) DEFAULT NULL,
  `provincia` varchar(50) DEFAULT NULL,
  `codigo_postal` varchar(10) DEFAULT NULL,
  `pais` varchar(50) NOT NULL DEFAULT 'Argentina',
  `latitud` decimal(10,8) DEFAULT NULL,
  `longitud` decimal(11,8) DEFAULT NULL,
  `categoria` enum('minorista','mayorista','distribuidor','consumidor_final') NOT NULL DEFAULT 'consumidor_final',
  `estado` enum('activo','inactivo','suspendido','bloqueado') NOT NULL DEFAULT 'activo',
  `limite_credito` decimal(12,2) DEFAULT NULL,
  `dias_credito` int(11) NOT NULL DEFAULT 0,
  `descuento_por_defecto` decimal(5,2) NOT NULL DEFAULT 0.00,
  `saldo_actual` decimal(12,2) NOT NULL DEFAULT 0.00,
  `condicion_iva` enum('responsable_inscripto','monotributista','exento','consumidor_final') NOT NULL DEFAULT 'consumidor_final',
  `numero_ingresos_brutos` varchar(50) DEFAULT NULL,
  `exento_iva` tinyint(1) NOT NULL DEFAULT 0,
  `contacto_alternativo` varchar(100) DEFAULT NULL,
  `telefono_alternativo` varchar(20) DEFAULT NULL,
  `email_alternativo` varchar(100) DEFAULT NULL,
  `direccion_facturacion` text DEFAULT NULL,
  `ciudad_facturacion` varchar(50) DEFAULT NULL,
  `provincia_facturacion` varchar(50) DEFAULT NULL,
  `codigo_postal_facturacion` varchar(10) DEFAULT NULL,
  `direccion_envio` text DEFAULT NULL,
  `ciudad_envio` varchar(50) DEFAULT NULL,
  `provincia_envio` varchar(50) DEFAULT NULL,
  `codigo_postal_envio` varchar(10) DEFAULT NULL,
  `instrucciones_envio` varchar(255) DEFAULT NULL,
  `obra_social` varchar(100) DEFAULT NULL,
  `numero_afiliado` varchar(50) DEFAULT NULL,
  `plan_obra_social` varchar(100) DEFAULT NULL,
  `alergias` text DEFAULT NULL,
  `medicamentos_actuales` text DEFAULT NULL,
  `condiciones_medicas` text DEFAULT NULL,
  `grupo_sanguineo` varchar(10) DEFAULT NULL,
  `factor_rh` varchar(5) DEFAULT NULL,
  `fecha_nacimiento` date DEFAULT NULL,
  `genero` enum('masculino','femenino','otro') DEFAULT NULL,
  `profesion` varchar(100) DEFAULT NULL,
  `empresa` varchar(100) DEFAULT NULL,
  `cargo` varchar(100) DEFAULT NULL,
  `observaciones` text DEFAULT NULL,
  `notas_internas` text DEFAULT NULL,
  `preferencias` longtext CHARACTER SET utf8mb4 COLLATE utf8mb4_bin DEFAULT NULL CHECK (json_valid(`preferencias`)),
  `etiquetas` longtext CHARACTER SET utf8mb4 COLLATE utf8mb4_bin DEFAULT NULL CHECK (json_valid(`etiquetas`)),
  `acepta_marketing` tinyint(1) NOT NULL DEFAULT 0,
  `acepta_newsletter` tinyint(1) NOT NULL DEFAULT 0,
  `fecha_ultima_compra` date DEFAULT NULL,
  `total_compras` decimal(12,2) NOT NULL DEFAULT 0.00,
  `cantidad_compras` int(11) NOT NULL DEFAULT 0,
  `promedio_compra` decimal(10,2) NOT NULL DEFAULT 0.00,
  `creado_por` varchar(100) DEFAULT NULL,
  `actualizado_por` varchar(100) DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  `deleted_at` timestamp NULL DEFAULT NULL,
  `Id_Licencia` varchar(100) DEFAULT NULL COMMENT 'Identificador de licencia del sistema'
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

