--

CREATE TABLE `componentes_activos` (
  `id` bigint(20) UNSIGNED NOT NULL,
  `nombre` varchar(200) NOT NULL,
  `descripcion` text DEFAULT NULL,
  `codigo` varchar(50) NOT NULL,
  `formula_quimica` varchar(100) DEFAULT NULL,
  `concentracion_estandar` decimal(8,3) DEFAULT NULL,
  `unidad_concentracion` varchar(20) DEFAULT NULL,
  `indicaciones` text DEFAULT NULL,
  `contraindicaciones` text DEFAULT NULL,
  `efectos_secundarios` text DEFAULT NULL,
  `interacciones` text DEFAULT NULL,
  `activo` tinyint(1) NOT NULL DEFAULT 1,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  `deleted_at` timestamp NULL DEFAULT NULL,
  `Id_Licencia` int(11) DEFAULT NULL COMMENT 'Identificador de licencia del sistema'
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

