--
-- Estructura de tabla para la tabla `movimientos_caja`
--

CREATE TABLE `movimientos_caja` (
  `id` bigint(20) UNSIGNED NOT NULL,
  `caja_id` bigint(20) UNSIGNED NOT NULL,
  `tipo` enum('entrada','salida') NOT NULL,
  `monto` decimal(15,2) NOT NULL,
  `concepto` varchar(255) NOT NULL,
  `descripcion` text DEFAULT NULL,
  `metodo_pago` enum('efectivo','tarjeta','transferencia','cheque','otro') NOT NULL DEFAULT 'efectivo',
  `referencia` varchar(255) DEFAULT NULL,
  `usuario_id` bigint(20) UNSIGNED NOT NULL,
  `venta_id` bigint(20) UNSIGNED DEFAULT NULL,
  `gasto_id` bigint(20) UNSIGNED DEFAULT NULL,
  `encargo_id` bigint(20) UNSIGNED DEFAULT NULL,
  `fecha_movimiento` timestamp NOT NULL,
  `saldo_anterior` decimal(15,2) NOT NULL,
  `saldo_posterior` decimal(15,2) NOT NULL,
  `confirmado` tinyint(1) NOT NULL DEFAULT 1,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  `deleted_at` timestamp NULL DEFAULT NULL,
  `Id_Licencia` varchar(100) DEFAULT NULL COMMENT 'Identificador de licencia del sistema'
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

-- --------------------------------------------------------

--
-- Estructura de tabla para la tabla `movimientos_inventario`
--

CREATE TABLE `movimientos_inventario` (
  `id` bigint(20) UNSIGNED NOT NULL,
  `producto_id` bigint(20) UNSIGNED NOT NULL,
  `sucursal_id` bigint(20) UNSIGNED NOT NULL,
  `almacen_id` bigint(20) UNSIGNED DEFAULT NULL,
  `personal_id` bigint(20) UNSIGNED DEFAULT NULL,
  `tipo_movimiento` enum('entrada_compra','entrada_devolucion','entrada_ajuste','entrada_transferencia','salida_venta','salida_devolucion','salida_ajuste','salida_transferencia','salida_merma','salida_vencimiento','reserva','liberacion_reserva') NOT NULL,
  `categoria_movimiento` enum('entrada','salida','ajuste','reserva') NOT NULL,
  `cantidad` int(11) NOT NULL,
  `cantidad_anterior` int(11) NOT NULL,
  `cantidad_nueva` int(11) NOT NULL,
  `costo_unitario` decimal(10,2) DEFAULT NULL,
  `costo_total` decimal(12,2) DEFAULT NULL,
  `numero_lote` varchar(50) DEFAULT NULL,
  `fecha_fabricacion` date DEFAULT NULL,
  `fecha_vencimiento` date DEFAULT NULL,
  `lote_proveedor` varchar(50) DEFAULT NULL,
  `numero_documento` varchar(50) DEFAULT NULL,
  `tipo_documento` varchar(50) DEFAULT NULL,
  `proveedor_id` bigint(20) UNSIGNED DEFAULT NULL,
  `cliente_id` bigint(20) UNSIGNED DEFAULT NULL,
  `venta_id` bigint(20) UNSIGNED DEFAULT NULL,
  `compra_id` bigint(20) UNSIGNED DEFAULT NULL,
  `ubicacion_origen` varchar(100) DEFAULT NULL,
  `ubicacion_destino` varchar(100) DEFAULT NULL,
  `observaciones` text DEFAULT NULL,
  `estado` enum('pendiente','confirmado','anulado','reversado') NOT NULL DEFAULT 'confirmado',
  `fecha_confirmacion` timestamp NULL DEFAULT NULL,
  `confirmado_por` bigint(20) UNSIGNED DEFAULT NULL,
  `creado_por` varchar(100) DEFAULT NULL,
  `actualizado_por` varchar(100) DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  `deleted_at` timestamp NULL DEFAULT NULL,
  `Id_Licencia` varchar(100) DEFAULT NULL COMMENT 'Identificador de licencia del sistema'
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

-- --------------------------------------------------------

--
-- Estructura de tabla para la tabla `notificaciones_citas`
--

CREATE TABLE `notificaciones_citas` (
  `Notificacion_ID` bigint(20) UNSIGNED NOT NULL,
  `Fk_Cita` bigint(20) UNSIGNED NOT NULL COMMENT 'ID de la cita',
  `Tipo_Notificacion` enum('Recordatorio','Confirmación','Cambio','Cancelación') NOT NULL COMMENT 'Tipo de notificación',
  `Medio_Envio` enum('SMS','Email','Push','WhatsApp') NOT NULL COMMENT 'Medio de envío de la notificación',
  `Estado_Envio` enum('Pendiente','Enviado','Fallido') NOT NULL DEFAULT 'Pendiente' COMMENT 'Estado del envío',
  `Fecha_Envio` timestamp NULL DEFAULT NULL COMMENT 'Fecha y hora del envío',
  `Mensaje` text DEFAULT NULL COMMENT 'Mensaje de la notificación',
  `Destinatario` varchar(200) NOT NULL COMMENT 'Destinatario de la notificación',
  `ID_H_O_D` varchar(100) NOT NULL COMMENT 'Identificador de la organización/hospital',
  `Agregado_Por` varchar(200) DEFAULT NULL COMMENT 'Usuario que agregó la notificación',
  `Agregado_El` timestamp NOT NULL DEFAULT current_timestamp() COMMENT 'Fecha y hora de creación',
  `Modificado_Por` varchar(200) DEFAULT NULL COMMENT 'Usuario que modificó la notificación',
  `Modificado_El` timestamp NULL DEFAULT NULL COMMENT 'Fecha y hora de modificación',
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  `deleted_at` timestamp NULL DEFAULT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

