--
-- Estructura de tabla para la tabla `planes_obra_social`
--

CREATE TABLE `planes_obra_social` (
  `id` bigint(20) UNSIGNED NOT NULL,
  `obra_social_id` bigint(20) UNSIGNED NOT NULL,
  `nombre` varchar(255) NOT NULL,
  `codigo` varchar(50) NOT NULL,
  `descripcion` text DEFAULT NULL,
  `cobertura_consulta` decimal(5,2) NOT NULL DEFAULT 100.00,
  `cobertura_estudios` decimal(5,2) NOT NULL DEFAULT 100.00,
  `cobertura_medicamentos` decimal(5,2) NOT NULL DEFAULT 100.00,
  `cobertura_procedimientos` decimal(5,2) NOT NULL DEFAULT 100.00,
  `costo_mensual` decimal(10,2) DEFAULT NULL,
  `costo_anual` decimal(10,2) DEFAULT NULL,
  `costo_adicional_familiar` decimal(10,2) DEFAULT NULL,
  `consultas_por_mes` int(11) DEFAULT NULL,
  `estudios_por_ano` int(11) DEFAULT NULL,
  `limite_medicamentos_mensual` decimal(10,2) DEFAULT NULL,
  `estado` enum('activo','inactivo','discontinuado') NOT NULL DEFAULT 'activo',
  `disponible_nuevos_afiliados` tinyint(1) NOT NULL DEFAULT 1,
  `observaciones` text DEFAULT NULL,
  `beneficios_adicionales` longtext CHARACTER SET utf8mb4 COLLATE utf8mb4_bin DEFAULT NULL CHECK (json_valid(`beneficios_adicionales`)),
  `restricciones` longtext CHARACTER SET utf8mb4 COLLATE utf8mb4_bin DEFAULT NULL CHECK (json_valid(`restricciones`)),
  `creado_por` varchar(100) DEFAULT NULL,
  `actualizado_por` varchar(100) DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  `deleted_at` timestamp NULL DEFAULT NULL,
  `Id_Licencia` varchar(100) DEFAULT NULL COMMENT 'Identificador de licencia del sistema'
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

-- --------------------------------------------------------

--
-- Estructura de tabla para la tabla `presentaciones`
--

CREATE TABLE `presentaciones` (
  `id` bigint(20) UNSIGNED NOT NULL,
  `nombre` varchar(100) NOT NULL,
  `descripcion` text DEFAULT NULL,
  `codigo` varchar(50) NOT NULL,
  `abreviatura` varchar(20) DEFAULT NULL,
  `activa` tinyint(1) NOT NULL DEFAULT 1,
  `orden` int(11) NOT NULL DEFAULT 0,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  `deleted_at` timestamp NULL DEFAULT NULL,
  `Id_Licencia` varchar(100) DEFAULT NULL COMMENT 'Identificador de licencia del sistema'
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

-- --------------------------------------------------------

--
-- Estructura de tabla para la tabla `procedimientos_medicos`
--

CREATE TABLE `procedimientos_medicos` (
  `id` bigint(20) UNSIGNED NOT NULL,
  `codigo` varchar(20) NOT NULL,
  `nombre` varchar(255) NOT NULL,
  `descripcion` text DEFAULT NULL,
  `especialidad_id` bigint(20) UNSIGNED DEFAULT NULL,
  `tipo` enum('consulta','procedimiento','cirugia','estudio','terapia') NOT NULL DEFAULT 'procedimiento',
  `complejidad` enum('baja','media','alta','critica') NOT NULL DEFAULT 'media',
  `ambito` enum('ambulatorio','hospitalario','emergencia','domiciliario') NOT NULL DEFAULT 'ambulatorio',
