--
-- Estructura para la vista `v_citas_hoy`
--
DROP TABLE IF EXISTS `v_citas_hoy`;

CREATE ALGORITHM=UNDEFINED DEFINER=`u155356178_SaludaCoreDevs`@`%` SQL SECURITY DEFINER VIEW `v_citas_hoy`  AS SELECT `c`.`Cita_ID` AS `Cita_ID`, `c`.`Titulo` AS `Titulo`, `c`.`Fecha_Cita` AS `Fecha_Cita`, `c`.`Hora_Inicio` AS `Hora_Inicio`, `c`.`Hora_Fin` AS `Hora_Fin`, `c`.`Estado_Cita` AS `Estado_Cita`, `c`.`Tipo_Cita` AS `Tipo_Cita`, concat(`p`.`Nombre`,' ',`p`.`Apellido`) AS `Paciente_Nombre`, `p`.`Telefono` AS `Paciente_Telefono`, `e`.`Nombre_Completo` AS `Especialista_Nombre`, `esp`.`Nombre_Especialidad` AS `Especialidad_Nombre`, `s`.`Nombre_Sucursal` AS `Sucursal_Nombre`, `co`.`Nombre_Consultorio` AS `Consultorio_Nombre`, `c`.`Color_Calendario` AS `Color_Calendario` FROM (((((`citas_mejoradas` `c` join `pacientes_mejorados` `p` on(`c`.`Fk_Paciente` = `p`.`Paciente_ID`)) join `especialistas` `e` on(`c`.`Fk_Especialista` = `e`.`Especialista_ID`)) join `especialidades` `esp` on(`e`.`Fk_Especialidad` = `esp`.`Especialidad_ID`)) join `sucursales_mejoradas` `s` on(`c`.`Fk_Sucursal` = `s`.`Sucursal_ID`)) left join `consultorios_mejorados` `co` on(`c`.`Fk_Consultorio` = `co`.`Consultorio_ID`)) WHERE `c`.`Fecha_Cita` = curdate() AND `c`.`Estado_Cita` in ('Pendiente','Confirmada','En Proceso') ORDER BY `c`.`Hora_Inicio` ASC ;

-- --------------------------------------------------------

--
-- Estructura para la vista `v_estadisticas_citas`
--
DROP TABLE IF EXISTS `v_estadisticas_citas`;

CREATE ALGORITHM=UNDEFINED DEFINER=`u155356178_SaludaCoreDevs`@`%` SQL SECURITY DEFINER VIEW `v_estadisticas_citas`  AS SELECT count(0) AS `Total_Citas`, count(case when `citas_mejoradas`.`Estado_Cita` = 'Pendiente' then 1 end) AS `Citas_Pendientes`, count(case when `citas_mejoradas`.`Estado_Cita` = 'Confirmada' then 1 end) AS `Citas_Confirmadas`, count(case when `citas_mejoradas`.`Estado_Cita` = 'En Proceso' then 1 end) AS `Citas_En_Proceso`, count(case when `citas_mejoradas`.`Estado_Cita` = 'Completada' then 1 end) AS `Citas_Completadas`, count(case when `citas_mejoradas`.`Estado_Cita` = 'Cancelada' then 1 end) AS `Citas_Canceladas`, count(case when `citas_mejoradas`.`Estado_Cita` = 'No Asistió' then 1 end) AS `Citas_No_Asistio`, count(case when `citas_mejoradas`.`Fecha_Cita` = curdate() then 1 end) AS `Citas_Hoy`, count(case when `citas_mejoradas`.`Fecha_Cita` = curdate() + interval 1 day then 1 end) AS `Citas_Manana` FROM `citas_mejoradas` WHERE `citas_mejoradas`.`Fecha_Cita` >= curdate() - interval 30 day ;

